      "settings#upstream-proxy#set-username-password-error-msg": "သင့်အနေဖြင့်အသုံးပြုသူအမည်နှင့် စကားဝှက်နှစ်ခုလုံးကို သတ်မှတ်ပေးရမည် သို့မဟုတ် တိုက်ဆိုင်စစ်ဆေးရန် မရှိပါက ကွက်လပ်အဖြစ်သာချန်ထားရန်။",
