      "settings#upstream-proxy#set-hostname-port-error-msg": "Maqaa-Qopheessaa fi buufataa tolchuu qabda, yookiin ofii isaa akka filatuuf lamaanuu duwwaa dhiisuu malta.",
      "settings#upstream-proxy#set-hostname-port-without-authentication-error-msg": "Maqaa fayyadamaa fi darbi-jechaa tolchuun maqaa qopheessaa fi buufataa tolchuu barbaada",
