      "settings#egress-region#default": "<strong>“ዝቐልጠፈት ሃገር”</strong> ዝብል ምምራጽ፡ ሳይፎን (Psiphon) ኣውቶማቲካዊ ሓደ ሰርቨር ክመርጽ የኽእል እዚ ድማ  ብሓፈሽኡ ናብ ዝሓሸ ርክብ ነትወርክ ከሕልፈካ `ውን ይኽእል፡፡",
