      "settings#egress-region#error-modal-body-http": "ሳሳይፎን (Psiphon)  ኣብ ፍሉይ ዞባ ሰርቨር ንኽጥቀም ኣዋዲድካዮ ኣለኻ <br>\n። እንተኾነ እቲ ዞባ ካብ ሎሚ ንድሓር የለን፡፡ <br>\n ሓዲሽ ኽሊ ክትመርጽ ኣለካ ወይ እቲ ዝጸንሐ \"ዝቐልጠፈት ሃገር \" ዝብል ቀይሮ።",
